- input: "TEXT\x1CC00458810\x1C.TEXT\x1C\x1CF3A\x1CThe principal balance of this loan
    and only the principal balance were repaid on 31 AUG 2009.  At the time of the
    original filing, I was working out to town and without access to the campaign's
    records.  Additionally, I was overwhelmed with the mechanics of a civil lawsuit
    that filed as a nusance by the CEO of a local NONPROFIT hospital only after I
    filed to run for Georgia 12th congressional seat.  This alleged breach of contract
    occurred while I was deployed to Afghanistan in 2003.  (More details are attached
    to my termination report)    Therefore, I was unsure that the transfer of these
    loan funds was effected on the requested day 31 AUG 2009.  In amending this report,
    I have firmly established and documented that the loan was indeed repaid on 31
    AUG 2009. \n"
